  return (
    <div className='text-center'>
     <h1 className='menu' style={{color:'purple'}}>Spicy Foods</h1> 
    <Row>
        {products.map((product=>(

          <Col sm={12} md={6} lg={4} xl={3} >
            {/* <h1>{product.description}</h1> */}
            <products />
          </Col>  
        )))}
    </Row>
    </div>
  )
}

export default SpicyFood
